    { id: 'wallet', text: 'Wallet', icon: 'üí∞' },
    { id: 'newPrompt', text: 'New Prompt', icon: '‚ûï' },
  ];

  return (
    <nav className="navigation-menu">
      {menuItems.map(item => (
